import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent implements OnInit{


  constructor(private router: Router) { }


  ngOnInit(): void {}

  CadUsuario() {
    return this.router.navigate(['/cadUsuario']);
  }
}
<div class="login">
  <h2>Faça seu login</h2>
  <div class="login-container">
      <h4>E-mail:</h4>
      <input type="email" alt="E-mail" placeholder="Digite seu E-mail" required/>
      <h4>Senha</h4>
      <input type="password" alt="senha" placeholder="Digite sua senha" required />
  </div>
  <div class="login-btn">
      <button type="submit" alt="Logar">Logar</button>
      <button (click)="CadUsuario()" alt="Criar Cadastro">Criar Cadastro</button>
  </div>
</div>
